import { Form } from "react-router-dom";
import Slider from "../components/Slider"

function Home(props) {
  return (
    <div className="">
      <Slider />
      <h1 className="text-3xl font-bold text-blue-600">
        Welcome to Home Page {props.name}!
      </h1>
    </div>
  );
}

export default Home;
